import React, { useState } from "react";
import CalWrapper from "../CalWrapper/CalWrapper";

const Cal = () => {

  const [inputVal1, setInputVal1] = useState(0);
  const allBtArr = [
    {
      value: 0,
      btFun: () => {
        setInputVal1(0);
      },
    },
    {
      value: 1,
      btFun: () => {
        setInputVal1(1);
      },
    },
    {
      value: 2,
      btFun: () => {
        console.log(2);
      },
    },
    {
      value: 3,
      btFun: () => {
        console.log(3);
      },
    },
    {
      value: 4,
      btFun: () => {
        console.log(4);
      },
    },
  ];

  return (
    <div>
      <p>This is Cal</p>
      <CalWrapper allBtArr={allBtArr} />
    </div>
  );
};

export default Cal;
